import { Link } from 'react-router-dom';
import { useState } from 'react';
import { useMemo } from 'react';
import axios from 'axios';
import './Main.css';
import ImageCard from './components/ImageCard';
import collage from './images/collage.jpeg';
import './Main.css';
const API_URL='https://api.unsplash.com/photos'
function Main(){
    const [images, setImages] = useState([]);

    const fetchAPI = async()=>{
    // const response = await axios.get('https://api.unsplash.com/photos/?client_id=YbnWcUQHyapMRVl5x8yCOn_I9inhl0dTOpCfNjy99no');
    const searchTerm = 'nature'; // Example search term
    const perPage = 20; // Number of results per page
    const clientId = 'YbnWcUQHyapMRVl5x8yCOn_I9inhl0dTOpCfNjy99no'; // Your Unsplash client ID

    const apiUrl = `https://api.unsplash.com/search/photos?query=${searchTerm}&per_page=${perPage}&client_id=${clientId}`;

    const response = await axios.get(apiUrl);


    const data = response.data;
    setImages(data);
    }
    useMemo(
      fetchAPI,[]
    )
    return (
        <div className='main'>
           <div className='items '>
                <Link to='./Collage' > <ImageCard title='Collage' image={collage}  /> </Link>
                {/* <Link to='./Carouseler' > <ImageCard title='Carouseler' image={collage} /> </Link> */}
                <Link to='./Scrolling' > <ImageCard title='Scrolling' image={collage} /></Link>
           </div>
        </div>
    );
}
export default Main;
